import './App.css';
import React from 'react';
import { useEffect } from 'react';
import Landing from './landing-page';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import CustomerEntryForm from './customer-entry-form';
import Login from './login';

function App() {
  useEffect(() => {
    const link = document.querySelector("link[href*='landing-page.css']");
      if (link) {
        link.href += "?v=" + new Date().getTime(); // Forces CSS to reload
      }
  }, []);

  return (
    <Router>
      <Routes>
        <Route path = "/login" element = {<Login />} />
        <Route path = "/customer-entry-form" element = {<CustomerEntryForm />} />
        <Route path = "/" element = {<Landing />} /> {}
      </Routes>
    </Router>
  );
}

export default App;
